import styled from '@emotion/styled'
import { Box, Typography } from '@mui/material'
import React from 'react'

function Header() {

    const nav_titles =[{
        path:'/',
        display:'Home'
    },
    {
        path:'/',
        display:'Dishes'
    },
    {
        path:'/',
        display:'Services'
    },
    {
        path:'/',
        display:'About us'
    }]

    const NavBarLinksBox = styled(Box)(({theme})=>({
     display:'flex',
     alignItems:'center',
     justifyContent:'center',
     gap:theme.spacing(3),
     [theme.breakpoints.down("md")]:{
        display:'none'
     }
    }))
  return (
    <Box>
        <Box>
    <Box>
        <NavBarLinksBox>
       {
         nav_titles.map((item,index)=>(
        <Typography>
         {item.display}
        </Typography>
         ))
       } 
       </NavBarLinksBox>
       
    </Box>
        </Box>
        <Box>

        </Box>
    </Box>
  )
}

export default Header
